function ifScript() {
	// Get the group id from system property
	var group_id = gs.getProperty('x_424363_ski_eva_1.skill_evaluation_manager_group','');
	
    var usr_grmber = new GlideRecord('sys_user_grmember');
    usr_grmber.addQuery('user', current.assigned_to);
	usr_grmber.addQuery('group', group_id);
	usr_grmber.query();	
	
    if (usr_grmber.next()) {
        return 'yes';
    }
    return 'no';
}

